import React from 'react';
import Banner from '../../components/Banner/Banner';
import Card from '../../components/Card/Card';
import Header from '../../components/Header/Header';
import Footer from '../../components/Footer/Footer';
import '../../components/Banner/Banner.css'; 
import '../../components/Card/Card.css'; 
import '../../components/Header/Header.css';
import '../../components/Footer/Footer.css';
import bannerImage from '../../assets/images/Banner1.png';
import logo from '../assets/images/LOGO2.png'; 

const Home = () => {
  const cardData = [
    { description: 'Titre de la location ' },
    { description: 'Titre de la location ' },
    { description: 'Titre de la location ' },
    { description: 'Titre de la location' },
    { description: 'Titre de la location' },
    { description: 'Titre de la location' },
  ];

  const footerData = {
    logoPath: logo,
    text: '© 2020 Kasa. All rights reserved'
  };

  return (
    <>
      <Header logo={logo} links={[
        { path: '/', label: 'Accueil' },
        { path: '/about', label: 'À propos' }
      ]} />
      <div className="home">
        <Banner title="Chez vous, partout et ailleurs" image={bannerImage} />
        <div className="home-content">
          <div className="cards-container">
            {cardData.map((card, index) => (
              <Card 
                key={index} 
                description={card.description} 
              />
            ))}
          </div>
        </div>
      </div>
      <Footer logo={footerData.logoPath} text={footerData.text} />
    </>
  );
};

export default Home;
